import React from "react";
import PropTypes from "prop-types";
import styles from "./TasksList.module.scss";
import Moment from "react-moment";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { clearTasks } from "../../../redux/actions/tasks";

const TasksList = ({ tasks, clearTasks }) => {
  const compare = (a, b) => {
    return Date.parse(b.date) - Date.parse(a.date);
  };
  const sortedTasks = [...tasks].sort(compare);

  const displayStatus = (deadLine, resolved) => {
    console.log(Date.now(), resolved);
    if (Date.parse(deadLine) < Date.now() && !resolved) return "Niewykonane";
    if (Date.parse(deadLine) > Date.now()) return "Do wykonania";
    if (resolved) return "Rozwiązane";
  };

  const displayOpenTask = ({
    task,
    deadLine,
    promptsAllowed,
    descriptionRequired,
    resolved,
  }) => (
    <div
      className={
        styles.openTask + " " + displayStatus(deadLine, resolved) ==
          "Niewykonane" && styles.failed
      }
    >
      <table>
        <tr>
          <td className={styles.name}>
            <Link
              onClick={() => clearTasks()}
              to={`/display/openTask/${task._id}`}
            >
              {task.name}
            </Link>
          </td>{" "}
          <td>
            {"Termin: "} <Moment format="YYYY/MM/DD HH:mm">{deadLine}</Moment>
          </td>
        </tr>
        <tr>
          <td>Podpowiedzi:{promptsAllowed ? " dostępne" : " niedostępne"}</td>{" "}
          <td>Opis: {descriptionRequired ? "wymagany" : "niewymagany"}</td>
        </tr>
        <tr>
          <td>Status: {displayStatus(deadLine, resolved)}</td>{" "}
        </tr>
      </table>
    </div>
  );

  const displayCloseTask = ({ task, deadLine, resolved }) => (
    <div
      className={
        styles.closeTask + " " + displayStatus(deadLine, resolved) ==
          "Niewykonane" && styles.failed
      }
    >
      <table>
        <tr>
          <td className={styles.name}>
            {" "}
            <Link
              onClick={() => clearTasks()}
              to={`/display/closeTask/${task._id}`}
            >
              {task.name}
            </Link>
          </td>{" "}
          <td>
            {"Termin: "} <Moment format="YYYY/MM/DD HH:mm">{deadLine}</Moment>
          </td>
        </tr>
        <tr>
          <td>Status: {displayStatus(deadLine, resolved)}</td>{" "}
        </tr>
      </table>
    </div>
  );

  const displayBooleanTask = ({ task, deadLine, resolved }) => (
    <div
      className={
        styles.booleanTask + "  " + displayStatus(deadLine, resolved) ==
        "Niewykonane"
          ? styles.failed
          : " "
      }
    >
      <table>
        <tr>
          <td className={styles.name}>
            {" "}
            <Link
              onClick={() => clearTasks()}
              to={`/display/booleanTask/${task._id}`}
            >
              {task.name}
            </Link>
          </td>{" "}
          <td>
            {"Termin: "} <Moment format="YYYY/MM/DD HH:mm">{deadLine}</Moment>
          </td>
        </tr>
        <tr>
          <td>Status: {displayStatus(deadLine, resolved)}</td>{" "}
        </tr>
      </table>
    </div>
  );

  return (
    <div className={styles.root}>
      {sortedTasks.map((item) => {
        if (item.taskType == "taskClose") return displayCloseTask(item);
        if (item.taskType == "taskOpen") return displayOpenTask(item);
        if (item.taskType == "taskBoolean") return displayBooleanTask(item);
      })}
    </div>
  );
};

TasksList.propTypes = {
  tasks: PropTypes.array.isRequired,
};

export default connect(null, { clearTasks })(TasksList);
